$(document).ready(()=>{$("#btnConfirmDelete").on("click",()=>{const a=$("#confirmDeleteModal");a.modal("hide");const b=a.attr("data-boat-id");showOverlayPanel("\u0423\u0434\u0430\u043B\u0435\u043D\u0438\u0435..."),$.ajax({type:"POST",url:`/boats/api/delete/${b}/`,success:function(a){hideOverlayPanel(),window.location.href=a.redirect},error:function(a){hideOverlayPanel(),showErrorToast(a.responseJSON.message)}})})});